import React from "react";
import { useHistory } from "react-router-dom";

function Magiczoomfixer() {
  let history = useHistory();
  let id = 0;
  let url = "";
  const params = useParams();
  id = params.id;
  url = params.url;
  history.push(/product/ + id + "/" + url);
  return "";
}

export default Magiczoomfixer;
